import React from 'react';
import "./Cards.css"

const Cards = (props) => {
    return (

    <div className='C'>
        
        <section className='img-product'>
            <img src={`/Assets/${props.img}`} alt="imagen de producto" />
        </section>

        <p>{props.descripcion}</p>

        <div>
            <h2>{props.name}</h2>
            <h4>$ {props.price}</h4>
        </div>

        <span>{props.ammount}</span>

    </div>

    );
}

export default Cards;
